import React, { useState, useEffect } from 'react';
import BookList from './Components/BookList';
import './App.css';

function App() {
  const [databaseBooks, setBooks] = useState([]);

  useEffect(() => {
    fetch("/api/books/").then(response => response.json()).then(data => {
        setBooks(data.items)
    });
  }, []);

  return (
    <div className="App">
      <div className="App-header">Butti</div>
      <div>
        <BookList books={databaseBooks} />
      </div>
    </div>
  );
}

export default App;
